import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Products from './components/Products'

const RouterC = () => {
    <BrowserRouter>
        <Switch>
            <Route exact path="/" component={Products} />
            <Route path="/iphone" />
            <Route path="/samsung" />
        </Switch>
    </BrowserRouter>
}



export default RouterC;
